# Apply smoothing with a window size of 50
def smooth(losses, window_size=50):
    kernel = np.ones(window_size) / window_size
    return np.convolve(losses, kernel, mode='valid')

# Smooth the training losses
smoothed_base_train = smooth(base_train_losses)
smoothed_ssmax_train = smooth(ssmax_train_losses)

# Update the original lists
base_train_losses = smoothed_base_train
ssmax_train_losses = smoothed_ssmax_train


plt.figure(figsize=(16, 10))

# Plot training losses (faded lines)
plt.plot(base_train_losses, alpha=0.3, label='Base (train, smoothed)', color='blue')
plt.plot(ssmax_train_losses, alpha=0.3, label='SSMax (train, smoothed)', color='red')

# Plot validation losses (solid points)
val_steps = list(base_val_losses.keys())
base_val_values = list(base_val_losses.values())
ssmax_val_values = list(ssmax_val_losses.values())

plt.plot(val_steps, base_val_values, label='Base (val)', color='blue')
plt.plot(val_steps, ssmax_val_values, label='SSMax (val)', color='red')
plt.ylim(3.7, 4.2)

plt.xlabel('Steps (*16k tokens)')
plt.ylabel('Loss')
plt.legend()
plt.grid(True, alpha=0.3)
plt.show()
plt.savefig("ssmax.png")


## Analyse fineweb seq_len distribution
# Load validation data
val_data = np.fromfile('./data/fineweb1B/fineweb_val_000000.bin', dtype=np.uint16)

# Find document boundaries (50256) and calculate sequence lengths
doc_ends = np.flatnonzero(val_data == 50256)
seq_lengths = np.diff(doc_ends)

# Create histogram
plt.figure(figsize=(16, 10))
plt.hist(seq_lengths, bins=np.geomspace(128, 128*1024, 21), alpha=0.7, log=True)
plt.xlabel('Sequence Length')
plt.ylabel('Count')
plt.title('Distribution of Document Lengths')
plt.grid(True, alpha=0.3)
plt.gca().set_xscale("log", base=2)
plt.gca().set_yscale("linear")
plt.savefig("seq_lengths_hist.png")
